    },
    props: {
        counters: Array,
        counterBgColor: {
            type: String,
            default: '#69979D',
        },
    },
    watch: {
        counters() {
            Object.keys(this.coordinates).forEach((k) => {
                let selected = this.structuredCounters.some((f) => f.code === k),
                    polyline = document.getElementById(this.idPrefix + k);

                if (!polyline) {
                    return;
                }

                if (!selected) {
                    polyline.setAttribute('fill', '#D4D1C7');
                } else {
                    polyline.setAttribute('fill', '#B6CDD0');
                }
            });
        },
    },
    computed: {
        idPrefix() {
            return 'provincesvg-' + this.randomId;
        },
        structuredCounters() {
            if (!this.counters) return [];

            return this.counters.map(counter => {
                let code = removeAccents(counter.name).toLowerCase().split('ñ').join('n').split(' ').join('-');
                code = this.aliases[code] || code;
                return {
                    name: counter.name,
                    count: counter.count,
                    references: counter.references,
                    code,
                };
            });
        },
    },
    emits: ['clickOnProvince'],
    methods: {
        click(key) {
            this.$emit('clickOnProvince', key);
            let references = this.structuredCounters.filter(c => c.code === key)[0].references;

            if (references) {
                this.$router.push({
                    name: 'AssetIndex',
                    hash: '#?references=' + references.join(','),
                });
            }
        },
    },
}
</script>

